import React from 'react';

function HeroSection() {
  return (
    <div className="hero-section bg-cover bg-center h-screen">
  <div className="hero-overlay flex flex-col items-center justify-center h-full">
    <h1 className="text-5xl font-bold hero-text mb-4">
      Explore the World with travel
    </h1>
    <p className="text-xl hero-text mb-8">
      Discover the best destinations and experiences with our expert travel
      guides.
    </p>
    <button className="bg-white text-gray-800 font-semibold py-2 px-4 rounded hover:bg-gray-200">
      BOOK NOW
    </button>
  </div>
</div>

  );
}

export default HeroSection;
